{
    let offset := add(32, add(data, index))
    let i := 0
    let n := 32
    for { }
    lt(n, size)
    {
        i := n
        n := add(n, 32)
    }
    {
        mstore(add(a, n), mload(add(offset, i)))
    }
    let suffix := add(a, add(32, size))
    let suffixWord := mload(suffix)
    mstore(add(a, n), mload(add(offset, i)))
    mstore(suffix, suffixWord)
    newIndex := add(index, size)
}

